body.query:
query pools {
  pools(first: 1000  orderBy: volumeUSD orderDirection: desc) {
      id
      token0 {id symbol name volume volumeUSD}
      token1 {id symbol name volume volumeUSD}
      token1Price volumeUSD
  }
}

{
  blocks(
    first: 1,
    orderBy: timestamp,
    orderDirection: desc,
    where: {
      timestamp_gt: 1626329996,
      timestamp_lt: 1626330596
    }
  ) {
    number,
    timestamp
  }
}
